export default function SnackbarComponent(open, onClose) {
    return (
        <div>
            <Snackbar
                open={open}
                autoHideDuration={4000}
                onClose={handleCloseSnackbar}
                anchorOrigin={{
                    vertical: "top",
                    horizontal: "center",
                }}
            >
                <Alert onClose={handleCloseSnackbar} severity="success">
                    Compte crée avec succès!
                </Alert>
            </Snackbar>
        </div>
    );
}
